import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [{
    path: '/',
    name: 'loginComponent',
    component: () =>
        import ( /* webpackChunkName: "loginComponent" */ '../components/Consultants.vue'),
}, ]

const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes
})

export default router
